import React, { useState } from 'react';


function App() {
    const [inputName,setInputName] = useState("");
    const [name,setName] = useState("");

    const [inputPsd,setInputPsd] = useState("");
    const [psd,setPsd] = useState("");

    const InputName = (e) => {
        setInputName(e.target.value);
    };
    const InputPassword = (e) => {
        setInputPsd(e.target.value);
    };

    const Submit = () => {
        setName(inputName);
        setPsd(inputPsd);
    };

    return (
        <>
            <div>
                <h1>Hello {name} {psd}</h1>
                <input type="text" placeholder='Enter Your Name' onChange={InputName} value={inputName} />
                <input type="text" placeholder='Enter Your Password' onChange={InputPassword} value={inputPsd} />
                <button onClick={Submit}>Click Me</button>
            </div>
        </>
    );
}

export default App;
